import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';

const StandardImageList = () => {
  return (
    <ImageList sx={{ width: 500, height: 450 }} cols={1} rowHeight={164}>
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
            srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: 'https://scheduling.rutgers.edu/sites/default/files/study-space-photos/IMG_5940.jpg',
    title: 'image1',
  },
  {
    img: 'https://fas.camden.rutgers.edu/files/campus-students.jpeg',
    title: 'image2',
  },
  {
    img: 'https://usacs.rutgers.edu/assets/img/programs/image2.png',
    title: 'image3',
  }
];

export default StandardImageList;
